import styled from 'styled-components'
import '../styles/theme.css'

const Input = ({className, value, defaultValue}) => (
  <InputStyles className={className} defaultValue={defaultValue} value={value} type='text' />
);

const InputStyles = styled('input')`
  display: block;
  height: 28px;
`;

export default Input;
